import React from 'react'
import { useState } from 'react'
import { styled, useTheme } from '@mui/material/styles'
import AppBar  from "@mui/material/Appbar"
import { IconButton, Toolbar, Typography, Stack, Button, Menu, MenuItem, Box } from "@mui/material"
import { Link } from 'react-router-dom';
import BiotechIcon from '@mui/icons-material/Biotech'
import MenuIcon from '@mui/icons-material/Menu'
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown'


const TempararyDrawer = () => {

    const [state, setState] = useState(false)

    const toggleDrawer = 
        (open: boolean) => 
        (event: React.KeyboardEvent | React.MouseEvent ) => {
            if (
                event.type  === 'keydown' &&
                ((event as React.KeyboardEvent).key === 'Tab' ||
                    (event as React.KeyboardEvent).key === 'Shift')
            ) {
                return
            }
            setState(open)
        }

    <Box
        sx={{ width: 350}}
        role='presentation'
        onClick={toggleDrawer(false)}
    >
        Dwawer Content
    </Box>
}

export const Navbar = () => {
    const [anchorEl, setAchorEl] = useState<null | HTMLElement>(null)
    const open = Boolean(anchorEl)
    const [openDrawer, setOpenDrawer] = useState(false)

    const handleClick = (event: React.MouseEvent<HTMLButtonElement>) => {
        setAchorEl(event.currentTarget)
    }

    const handleClose = () => {
        setAchorEl(null)
    }

    const handleDrawerOpen = () => {
        setOpenDrawer(true)
    }
    const handleDrawerClose = () => {
        setOpenDrawer(false)
    }


    return (
        <Box sx={{ display: 'flex'}}>
            <AppBar position='fixed'>  
                <Toolbar>
                    <IconButton size='large' edge='start' color='inherit' aria-label='logo'>
                        <BiotechIcon/>
                    </IconButton>
                    <Typography noWrap variant='h6' component='div' sx={{flexGrow: 1}}>
                        GENE-Works
                    </Typography>
                    <Stack direction='row' spacing={2}>
                        <Button color='inherit' component={Link} to='/graph'>Graph 1</Button>
                        <Button color='inherit'>Graph 2</Button>
                        <Button id='ui-button'
                            color='inherit'
                            onClick={handleClick}
                            aria-control={open ? 'ui-menu': undefined}
                            aria-haspopup='true'
                            aria-expanded={open ? 'true' : undefined}
                            endIcon={<KeyboardArrowDownIcon/>}
                        >UI</Button>
                    </Stack>
                    <Menu id='ui-menu' 
                        anchorEl={anchorEl}
                        open={open}
                        MenuListProps={{
                            'aria-labelledby': 'ui-button'
                        }}
                        onClose={handleClose}
                        anchorOrigin={{
                            vertical:'bottom',
                            horizontal:'right',
                        }}
                        transformOrigin={{
                            vertical: 'top',
                            horizontal: 'right'

                        }}
                    >
                        <MenuItem 
                            component={Link} 
                            to='/exbox' 
                            onClick={handleClose} 
                        >Box</MenuItem>
                        <MenuItem 
                            component={Link} 
                            to='/exstack'
                            onClick={handleClose}
                        >Stack</MenuItem>
                        <MenuItem 
                            component={Link} 
                            to='/exgrid'
                            onClick={handleClose}
                        >Grid</MenuItem>
                    </Menu>
                    <IconButton
                        color='inherit'
                        aria-label='open drawer'
                        edge='end'
                        onClick={handleToggleDrawer}
                        sx={{ ...(open && {display:'none'}) }}
                    >
                        <MenuIcon/>
                    </IconButton>

                </Toolbar>
            </AppBar>
        </Box>
    )
}
